import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import BackImage from './assets/airplane-2748431_960_720.png';
import Cari from './Cari';
import hasilPencarian from "./HasilPencarian";
import { ImageBackground } from "react-native";

const stack = createStackNavigator();

function App(){
  return(
    <ImageBackground source={require('./assets/airplane-2748431_960_720.png')} style={styles.Navigator}>
      <NavigationContainer>
        <stack.Navigator>
          <stack.Screen
            name="Cari"
            component={Cari}
            options={{
              header: () => null
            }}
          />
          <stack.Screen
            name="Hasil Pencarian"
            component={hasilPencarian}
          />
        </stack.Navigator>
      </NavigationContainer>
    </ImageBackground>
  )
}
